import React, { useState, useEffect } from 'react';
import { useAuth } from '../../context/AuthContext';
import LifeCountdown from './LifeCountdown';
import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';
import axios from 'axios';

const Dashboard = () => {
  const { user } = useAuth();
  const [lifeData, setLifeData] = useState(null);
  const [milestones, setMilestones] = useState([]);
  const [recommendations, setRecommendations] = useState([]);

  useEffect(() => {
    const fetchLifeData = async () => {
      try {
        const config = {
          headers: {
            'x-auth-token': localStorage.getItem('token')
          }
        };
        const res = await axios.get('http://localhost:3001/api/user/life-expectancy', config);
        setLifeData(res.data);
        generateMilestones(res.data);
        generateRecommendations(user.profile);
      } catch (err) {
        console.error('Error fetching life data:', err);
      }
    };

    if (user?.profile?.birthdate) {
      fetchLifeData();
    }
  }, [user]);

  const generateMilestones = (data) => {
    const age = Math.floor(data.daysLived / 365);
    const milestones = [
      {
        age: Math.max(0, age + 5),
        title: '5 Year Goal',
        description: 'Short-term life goals and achievements'
      },
      {
        age: Math.max(0, age + 10),
        title: '10 Year Milestone',
        description: 'Mid-term aspirations and plans'
      },
      {
        age: Math.floor(data.lifeExpectancy * 0.75),
        title: 'Golden Years',
        description: 'Retirement and legacy planning'
      }
    ];
    setMilestones(milestones);
  };

  const generateRecommendations = (profile) => {
    const recommendations = [];

    if (profile.lifestyle.smoker) {
      recommendations.push({
        title: 'Quit Smoking',
        description: 'Could add up to 10 years to your life expectancy',
        impact: 'high'
      });
    }

    if (profile.lifestyle.drinker) {
      recommendations.push({
        title: 'Reduce Alcohol',
        description: 'Could add up to 5 years to your life expectancy',
        impact: 'medium'
      });
    }

    recommendations.push({
      title: 'Regular Exercise',
      description: 'Aim for 150 minutes of moderate activity per week',
      impact: 'high'
    });

    recommendations.push({
      title: 'Healthy Diet',
      description: 'Maintain a balanced diet rich in fruits and vegetables',
      impact: 'high'
    });

    setRecommendations(recommendations);
  };

  if (!user?.profile?.birthdate) {
    return (
      <div className="text-center text-gray-600 p-8">
        Please complete your profile to see your dashboard.
      </div>
    );
  }

  if (!lifeData) {
    return (
      <div className="text-center text-gray-600 p-8">
        Loading your life data...
      </div>
    );
  }

  return (
    <div className="max-w-6xl mx-auto p-6">
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {/* Main Countdown Section */}
        <div className="bg-white rounded-lg shadow-lg p-6">
          <h2 className="text-2xl font-bold mb-4 text-gray-800">Life Countdown</h2>
          <LifeCountdown />
        </div>

        {/* Progress Visualization */}
        <div className="bg-white rounded-lg shadow-lg p-6">
          <h2 className="text-2xl font-bold mb-4 text-gray-800">Life Progress</h2>
          <div className="w-48 h-48 mx-auto">
            <CircularProgressbar
              value={parseFloat(lifeData.percentCompleted)}
              text={`${lifeData.percentCompleted}%`}
              styles={buildStyles({
                pathColor: `rgba(62, 152, 199, ${lifeData.percentCompleted / 100})`,
                textColor: '#3e98c7',
                trailColor: '#d6d6d6'
              })}
            />
          </div>
        </div>

        {/* Milestones Section */}
        <div className="bg-white rounded-lg shadow-lg p-6">
          <h2 className="text-2xl font-bold mb-4 text-gray-800">Life Milestones</h2>
          <div className="space-y-4">
            {milestones.map((milestone, index) => (
              <div key={index} className="border-l-4 border-blue-500 pl-4">
                <h3 className="text-lg font-semibold text-gray-800">
                  Age {milestone.age}: {milestone.title}
                </h3>
                <p className="text-gray-600">{milestone.description}</p>
              </div>
            ))}
          </div>
        </div>

        {/* Recommendations Section */}
        <div className="bg-white rounded-lg shadow-lg p-6">
          <h2 className="text-2xl font-bold mb-4 text-gray-800">Recommendations</h2>
          <div className="space-y-4">
            {recommendations.map((rec, index) => (
              <div key={index} className={`p-4 rounded-lg ${
                rec.impact === 'high' ? 'bg-red-50 border-red-200' :
                rec.impact === 'medium' ? 'bg-yellow-50 border-yellow-200' :
                'bg-green-50 border-green-200'
              } border`}>
                <h3 className="text-lg font-semibold text-gray-800">{rec.title}</h3>
                <p className="text-gray-600">{rec.description}</p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
